  false,\n\t\"url\": null,\n\t\"notes\": \"The Light Detection and Ranging (LiDAR)
  dataset is a survey of the Suwannee River G14PD00206 0.7 Meter LiDAR Survey in central
  Florida and encompasses 571 square miles. The LiDAR point cloud was flown at a nominal
  post spacing of 0.7 meters for unobscured areas. The LiDAR data and derivative products
  produced are in compliance with the U.S. Geological Survey National Geospatial Program
  Guidelines and Base Specifications, Version 1. The flight lines were acquired by
  Digital Aerial Solutions, LLC. between Feb 19, 2014 and March 1st , 2014. Derivative
  products from the aerial acquisition include: Raw point cloud data in LAS v1.2,
  classified point cloud data in LAS v1.2, bare earth surface tiles (raster DEM ERDAS
  Imagine format), bare earth surface DEMs mosaic (raster DEM ESRI Arc Grid format),
  control points, project report, and FGDC compliant XML metadata.\",\n\t\"license_title\":
